import { useEffect, useState } from "react";

const NotesList = () => {

    const [notes, setNotes] = useState([]);

    useEffect((e) => {
        e.preventDefault();
        fetch('http://localhost:3004/items')
            .then(res => res.json())
            .then(data => setNotes(data))
    }, [])

    return (
        <div>
            <div>
                <table>
                    <thead>
                        <th>S.No</th>
                        <th>Name</th>
                        <th>Actions</th>
                    </thead>
                    <tbody>
                        {notes.map(n => {
                            return (
                                <tr key={n.id}>
                                    <td>{n.id}</td>
                                    <td>{n.note}</td>
                                    <td>Actions</td>
                                </tr>
                            )
                        })}
                    </tbody>
                </table>
            </div>

        </div>
    );
}

export default NotesList;
